import React from 'react';

const Contact = () => {
	return (
		<div className='container-fluid'>
			<div className='row'>
				<div className='col-lg-10 offset lg-1'>
					<div className='d-flex justify-content-start align-items-center'>
						<h1>Phone</h1>
						<p>98456372834</p>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Contact;
